nb-NO.alert_help_2:
ActionCuts fungerer ved å se etter spesielt formaterte kommentarer i en snarvei. Den erstatter kommentaren med det fullstendige innholdet i en annen snarvei eller et handlingsområde fra ActionCuts-biblioteket for handlings blokker.

Hver kommentar inneholder en enkelt linje med tekst:

{{ActionCuts Shortcut:XYZ}}

Eller

{{ActionCuts Action:XYZ}}

der XYZ er navnet på snarveien eller handlingen blokk å bygge inn.

